import React from "react";

import Appone from "./appone";
import {Switch, Route } from "react-router-dom";
import master from "./Master";
const  App=() => {
  return (
    <Switch>
      <Route path="/" component={master}></Route>
      <Route path="/days" component={Appone}></Route>
    </Switch>
  );
}

export default App;
